def mainLoop(n,patternFind=False):
    global grid, tickCount,heightAnswer,setAdd#, lastTopDepth
    lastTopDepth = 0
    for rockFallCount in range(n):
        x,y = 2,0
        shapeIndex = rockFallCount % shapesLen
        shape = shapes[shapeIndex]
        shapeHeight = len(shape)
        newLinesCount = shapeHeight+3
        grid = [blankRow for _ in range(newLinesCount)] + grid
        while True:
            #blow sideways
            windex = tickCount % windsLen
            wind = winds[windex]
            dir = [wind,0]
            canMoveSide = checkCanMove(dir,shape,grid,[x,y])
            if canMoveSide: 
                xx,yy = dir
                x,y = x+xx, y+yy
            tickCount += 1
            #try and drop 1 and place it if false (it cant)
            dir = dirs[1]
            canMoveDown = checkCanMove(dir,shape,grid,[x,y])
            if canMoveDown:
                xx,yy = dir
                x,y = x+xx, y+yy
            else:
                break
        printShape(grid,shape,[x,y],save=True)
        lastTopDepth = getLastTop()
        grid = grid[lastTopDepth:]
        if patternFind:
            if rockFallCount >= 90:
                setAdd = "".join(grid[:90])
                if setAdd in sett:
                    global baseRocks,bodyRocks
                    baseRocks = sett[setAdd][1]
                    bodyRocks = rockFallCount - baseRocks
                    break
                sett[setAdd] = [grid[:20],rockFallCount]


    #gridHeight = len(grid)
    #heightAnswer += gridHeight-lastTopDepth
    #return heightAnswer 
    return len(grid)

def reset():
    global grid, tickCount,sett,setAdd,heightAnswer
    sett = {}
    heightAnswer = 0
    setAdd = ""
    heightAnswer = 0
    grid, tickCount = [], 0

